// Report2.js
import React from 'react';
import { Link } from 'react-router-dom';
import myImage from './chamoli.png'; // Update the path to your image

function Report2() {
  return (
    <div>
      <h1>Data Coordinates Visualization</h1>
      <img 
        src={myImage} 
        alt="Report Visual" 
        style={{ width: '100%', height: 'auto', marginTop: '20px' }} // Adjust styling as needed
      />
      <div style={{ marginTop: '20px' }}>
        <Link to="/report">
          <button>Go to Report </button>
        </Link>
      </div>
    </div>
  );
}

export default Report2;
